// App.js
import React from "react";
import { BrowserRouter as Router, Routes, Route } from "react-router-dom";
// import Footer from "./components/Footer";
import Header from "./components/Header";
import HomePage from "./pages/HomePage/HomePage";
import Footer from "./components/Footer";
import { CartProvider } from "./pages/HomePage/CartContext";
import BetSlip from "./components/BetSlip";
import WinningPredictions from "./pages/HomePage/WinningPredictions";
import Admin from "./admin/Admin";
import OtherMatchCard from "./pages/HomePage/Othersleagues";
import PredMatchForm from "./admin/PredictionForm";
import WinningPredictionForm from "./components/WinningPredictionForm";
import MatchForm from "./components/MatchForm";
// import AuthPage from "./components/AuthPage";
// import AuthForm from "./components/AuthForm";

const App = () => {
  return (
    <CartProvider>
    <Router>
      <Header />
      <Routes>
        <Route path="/" element={<HomePage/>} />
        <Route path="/cart" element={<BetSlip />} />
        <Route path="/add" element={<WinningPredictions />} />
        <Route path="/addtips" element={<OtherMatchCard />} />
        <Route path="/admin" element={<Admin />} />
        <Route path="/edit/:id" element={<PredMatchForm />} />
          <Route path="/" element={<OtherMatchCard />} />
          <Route path="/add" element={<MatchForm />} />
          <Route path="/edit/:id" element={<MatchForm />} />
        <Route path="/winning-predictions" element={<WinningPredictions />} />
<Route path="/winning-predictions/new" element={<WinningPredictionForm />} />
<Route path="/winning-predictions/edit" element={<WinningPredictionForm />} />

        {/* Future pages can be added here */}
        {/* <Route path="/" element={<AuthForm />} /> */}
      </Routes>
      <Footer />
    </Router>
    </CartProvider>
  );
};

export default App;
